import React from "react";
import TableauEmbed from "./TableauEmbed";

function Dashboard() {
  return (
    <div className="min-h-screen bg-red-50 text-red-900 px-6 py-16">
      <h2 className="text-4xl font-bold mb-4 text-center">
        Interactive Earthquake Dashboard
      </h2>
      <p className="text-center text-lg max-w-2xl mx-auto mb-10">
        Explore earthquake trends and insights in real-time with our interactive Tableau-powered visualization.
      </p>
      <div className="border-4 border-red-400 rounded-xl shadow-lg overflow-hidden bg-white">
        <TableauEmbed />
      </div>
    </div>
  );
}

export default Dashboard;
